import React from 'react';
import { SafeAreaView, Text, TextInput } from 'react-native';


export default function Information() {
  return (
    <SafeAreaView>
          <Text>Hey,</Text>
          <Text>Login Now.</Text>
        <View>
          <Text>If you are new /</Text>
          <Text>Craete New</Text>
        </View>
        <View>
          <TextInput placeholder='Dstudio_agency' placeholderTextColor={'black'} />
        </View>
        <View>
          <TextInput placeholder='Password' />
        </View>
        <View>
          <Text></Text>
        </View>
    </SafeAreaView>
  );
}
